import React from 'react'
export default function Answer() {
    return (
        <div>
            <div className="container" >
                <div className="row justify-content-center" style={{ margin:"0 auto", height:"200px", width:"90%",boxShadow: "0px 0px 40px 0px rgba(0,0,0,0.75)"}}>
                    <div className="col-9 align-self-center" style={{ height:"50px", backgroundColor:"black"}}>
                    </div>
                </div>
            </div>
        </div>
    )
}
